import NumberButton from "./NumberButton"
// import { useState } from "react"


const Number = (props) =>  {

    const {setnum,num} = props
    const handleClick = (e) =>{
        setnum(num.concat(e.target.value))
        console.log(e.target.value);
    }
    return(
            <div className="number-button-body">
                <NumberButton id="1" value="1" onClick={handleClick} />
                <NumberButton id="2" value="2" onClick={()=>{setnum(2)}}/>
                <NumberButton id="3" value="3" onClick={()=>{setnum(3)}}/>
                <NumberButton id="4" value="4" onClick={()=>{setnum(4)}}/>
                <NumberButton id="5" value="5" onClick={()=>{setnum(5)}}/>
                <NumberButton id="6" value="6" onClick={()=>{setnum(6)}}/>
                <NumberButton id="7" value="7" onClick={()=>{setnum(7)}}/>
                <NumberButton id="8" value="8" onClick={()=>{setnum(8)}}/>
                <NumberButton id="9" value="9" onClick={()=>{setnum(9)}}/>
                <NumberButton id="0" value="0" onClick={()=>{setnum(0)}}/>
                <NumberButton id="00" value="00" onClick={()=>{setnum(Number('00'))}}/>
                <div className="number-button">.</div>
            </div>
    )
}


export default Number
